  BrowserRouter as Router,
  Routes,
  Route
} from 'react-router-dom'
export default function App() {
  return (
    <Router>
      <div>
        <Routes>
          <Route exact path='/' element={<Home />} />
          <Route exact path='/login' element={<Loginpage/>}/>
          <Route exact path='/createuser' element={<Signup/>}/>
        </Routes>
      </div>
    </Router>
  )
}
